package Saturday_Lab1.Que_1;public class Student {    int sid;    String sname;    String saddr;    String cname;    public Student() {        super();    }    public Student(int sid, String sname, String saddr) {        this.sid= sid;        this.sname = sname;        this.saddr = saddr;        this.cname ="ABC Technical Institute";    }    public Student(int sid, String sname, String saddr, String cname) {        this.sid= sid;        this.sname = sname;        this.saddr = saddr;        this.cname = cname;    }    public String getCname() {        return cname;    }    public String getSaddr() {        return saddr;    }    public int getSid() {        return sid;    }    public String getSname() {        return sname;    }    public void setCname(String cname) {        this.cname = cname;    }    public void setSaddr(String saddr) {        this.saddr = saddr;    }    public void setSid(int sid) {        this.sid = sid;    }    public void setSname(String sname) {        this.sname = sname;    }    public void display() {        System.out.println("\n\nStudent Id: "+sid);        System.out.println("Student Name:"+sname);        System.out.println("Student Address :"+saddr);        System.out.println("Student College Name: "+cname);    }}